  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ottawa,
  Cedar Point, and West Sister Island National Wildlife Refuges outlines Refuge accomplishments
  during the 1989 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. The report includes a planning section which discusses public
  participation, compliance with environmental and cultural resources mandates, and
  research and investigations. Refuge administration is outlined; information about
  personnel, youth programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, croplands,
  fire management, pest control, and wilderness areas. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
  scientific collections, and marking and bird banding. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  fishing, trapping, wildlife observation, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  equipment utilization and replacement, communication systems, and computer systems.
  Cooperative programs and items of interest are provided at the end. Refuge brochures
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
